import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {
  return (
    <div className='hero-container'>
      <video src='/videos/video-1.mp4' autoPlay loop muted />
      <h1>Welcome to Catfish</h1>
      <p>Find your Purrrfect mate today</p>
      <div className="hero-bts">
      <a href='/Leanrmore' role="button" className="btn btn--primary btn-lg">Learn More</a>
      <a href='/Explore' role="button" className="btn btn--secondary btn-lg">Create an Account</a>
      </div>
    </div>
  );
}

export default HeroSection;
